	<style type="text/css">
		* {
			margin: 0;
			padding: 0;
			-webkit-box-sizing: border-box;
			-moz-box-sizing: border-box;
			box-sizing: border-box;
		}
		html,
		body {
			height: 100%;
			overflow-y: auto;
			-webkit-overflow-scrolling: touch;
		}
		body {
			background: #eae8e1;
			display: flex;
			display: -webkit-flex;
			justify-content: center;
			-ms-align-items: center;
			align-items: center;
		}
		.btns {
			display: block;
			margin: 0;
		}
		.btns_btn {
			display: block;
			perspective: 150px;
			margin: 30px 0 0;
			width: 20em;
			text-align: center;
			transition: all .4s;
		}
		.btns_btn > a {
			display: block;
			text-decoration: none;
			color: inherit;
			background: #000;
			color: #75D9A4;
			font-weight: bold;
			font-size: 20px;
			-webkit-transform-origin: 0 0;
			-moz-transform-origin: 0 0;
			-ms-transform-origin: 0 0;
			-o-transform-origin: 0 0;
			transform-origin: 0 0;
			-webkit-transform: rotateY(-10deg);
			-ms-transform: rotateY(-10deg);
			-o-transform: rotateY(-10deg);
			transform: rotateY(-10deg);
			overflow: hidden;
			position: relative;
			left: 0;
			-webkit-transition: all .4s;
			-o-transition: all .4s;
			transition: all .4s;
		}
		.btns_btn > a > span {
			display: block;
			padding: 20px 0;
			-webkit-transform-origin: right 0;
			-moz-transform-origin: right 0;
			-ms-transform-origin: right 0;
			-o-transform-origin: right 0;
			transform-origin: right 0;
			-webkit-transform: rotateY(10deg);
			-ms-transform: rotateY(10deg);
			-o-transform: rotateY(10deg);
			transform: rotateY(10deg);
		}

		.btns_btn:nth-of-type(2n - 1) > a >span {
			margin-right: -43px;
		}
		.btns_btn:nth-of-type(2n) {
			margin-left: 86px;
		}
		.btns_btn:nth-of-type(2n) > a {
			-webkit-transform-origin: right 0;
			-moz-transform-origin: right 0;
			-ms-transform-origin: right 0;
			-o-transform-origin: right 0;
			transform-origin: right 0;
			-webkit-transform: rotateY(10deg);
			-ms-transform: rotateY(10deg);
			-o-transform: rotateY(10deg);
			transform: rotateY(10deg);
		}
		.btns_btn:nth-of-type(2n) > a > span {
			margin-left: -86px;
			-webkit-transform-origin: 0 0;
			-moz-transform-origin: 0 0;
			-ms-transform-origin: 0 0;
			-o-transform-origin: 0 0;
			transform-origin: 0 0;
			-webkit-transform: rotateY(-10deg);
			-ms-transform: rotateY(-10deg);
			-o-transform: rotateY(-10deg);
			transform: rotateY(-10deg);
		}

		.btns_btn > a:hover {
			background: #a00;
			color: #FFD792;
			left: 50px;
		}
		.jb {
			position: fixed;
			bottom: 0;
			left: 0;
		}
	</style>
